--
-- 表的结构 `clt_flow`
-- 
DROP TABLE IF EXISTS `clt_flow`;
CREATE TABLE `clt_flow` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `thumb` varchar(225) NOT NULL DEFAULT '',
  `userid` int(8) unsigned NOT NULL DEFAULT '0',
  `username` varchar(40) NOT NULL DEFAULT '',
  `listorder` int(10) unsigned NOT NULL DEFAULT '0',
  `createtime` int(11) unsigned NOT NULL DEFAULT '0',
  `updatetime` int(11) unsigned NOT NULL DEFAULT '0',
  `istrash` int(11) unsigned NOT NULL DEFAULT '0',
  `orderid` varchar(255) NOT NULL DEFAULT '',
  `remark` varchar(255) NOT NULL DEFAULT '',
  `fid` int(11) unsigned NOT NULL DEFAULT '0',
  `income` decimal(10,2) unsigned NOT NULL DEFAULT '0.00',
  `outer` decimal(10,2) unsigned NOT NULL DEFAULT '0.00',
  `pics` varchar(80) NOT NULL DEFAULT '',
  `status` varchar(255) NOT NULL DEFAULT '1',
  `collate` int(10) unsigned NOT NULL DEFAULT '0',
  `fengcun` int(10) unsigned NOT NULL DEFAULT '0',
  `repeat` tinyint(3) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `orderid` (`orderid`),
  KEY `fid` (`fid`)
) ENGINE=MyISAM AUTO_INCREMENT=168 DEFAULT CHARSET=utf8;

